import React from 'react';
import './menu.css';
import Select from '@mui/material/Select';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import InputLabel from '@mui/material/InputLabel';

const Sidebar = () => {
  return (
    <div className='sidebar'>
      <header>
        <h3>Filtros</h3>
      </header>

      <div className="filter-container">
        <FormControl variant="outlined" className="filter">
          <InputLabel>Tipo de clase</InputLabel>
          <Select label="Tipo de clase">
            <MenuItem value="individual">Individual</MenuItem>
            <MenuItem value="grupal">Grupal</MenuItem>
          </Select>
        </FormControl>

        <FormControl variant="outlined" className="filter">
          <InputLabel>Frecuencia</InputLabel>
          <Select label="Frecuencia">
            <MenuItem value="unica">Única</MenuItem>
            <MenuItem value="semanal">Semanal</MenuItem>
            <MenuItem value="mensual">Mensual</MenuItem>
          </Select>
        </FormControl>

        <FormControl variant="outlined" className="filter">
          <InputLabel>Calificación</InputLabel>
          <Select label="Calificación">
            <MenuItem value={1}>1 estrella</MenuItem>
            <MenuItem value={2}>2 estrellas</MenuItem>
            <MenuItem value={3}>3 estrellas</MenuItem>
            <MenuItem value={4}>4 estrellas</MenuItem>
            <MenuItem value={5}>5 estrellas</MenuItem>
          </Select>
        </FormControl>
      </div>
    </div>
  );
};

export default Sidebar;
